import React, { Component } from "react";
import "./App.css";
import {Switch, Route} from 'react-router-dom'

class App extends Component {
  state = {
    isSignedIn: false
  }

  render() {
    return (
      <Switch>
        <Route exact path="/" />
      </Switch>
    );
  }
}

export default App;
